import { USER } from "../actionTypes";
import { UserElement } from "../../assets/propTypes";
interface IAppState {
  toDoList: any[];
}

const initialState: UserElement = {
  password: '',
  job: false,
  country: 'tr',
  service: 156,
  quoteNumber: 2,
  deal: false
};

export default function (state = initialState, action: string) {
  switch (action.type) {
    case USER: {
      return {
        ...state,
        berk: state.country
      }
    };

    default:
      return state;
  }
}
